import React, { Component } from 'react'

export class Timeline extends Component {
    // let {posts} = this.props
    getAllPosts = () => {
        let { posts } = this.props
        return posts.map((post) => {
            return <Post post={post} key={post.id} />
        })
    }

    render() {
        return (
            <div>
                {this.getAllPosts()}
            </div>
        )
    }
}

export default Timeline
